column8:
スター・ウォーズ 12インチフィギュアシリーズに『スター・ウォーズ/フォースの覚醒』に登場した<br>ドロイド達の3体セット商品が登場。<br>
人気のBB-8は頭部が可動し、付属のアームパーツ2種が胴体部分に取り付け可能です。<br>
更に劇中で左腕が赤茶になった姿が印象的だったC-3POと<br>レジスタンスのXウイング・スターファイターに搭乗するドロイドRO-4LOがセットとなります。<br><br>

[セット内容]<br>
BB-8本体×1、C-3PO本体×1、R0-4LO本体×1<br>BB-8用パーツ×2、BB-8用取り付け用カバー×2
<br><br>

※写真は試作品です。<br>
実際の製品とは仕様、デザインが若干異なる場合がございます。<br><br><FONT color="#ff0000">※パッケージに多少の傷み、汚れ等ある場合がございます。予めご了承のうえお買い求めください。</FONT><style type="text/css">
